import React from 'react'
import Sdata from './Sdata';
import Card from './Card';


let Name = "Netflix";
const Check = () => {

    if (Name === "Netflix") {
        <Card
            key={Sdata[3].id}
            imgsrc={Sdata[3].imgsrc}
            cardTitle={Sdata[3].cardTitle}
            link={Sdata[3].link}
        />
    }
    else {

    }
}


const App = () => (
    <>
        <Check />
    </>

)

export default App;
